         {
           "id": "salary",
           "filters": [
             {"id": "0", "label": "filter_salary_less_1000"},
             {"id": "1", "label": "filter_salary_1000_2000"},
             {"id": "2", "label": "filter_salary_2000_3000"},
             {"id": "3", "label": "filter_salary_more_3000"}
